а… Нет, мы только что, - ответила Иза, оглядывая пытливо возбужденное лицо авантюриста. Нет, и хочу попробовать, но не здесь… Божественно глупо, но хорошо! Документы его ни в каком случае не могли пригодиться ему, наоборот, - могли скомпрометировать, и он их сжег в камине, вместе с какими-то счетами и двумя-тремя тетрадками, но один из документов - японская рукопись на нескольких страницах плотной бумаги остановила его внимание, потому что вторая половина состояла из адресов и фамилий, причем адреса были написаны латинскими буквами… Он присмотрелся внимательнее, - это были лондонские, парижские, марсельские, ниццкие, миланские и римские, берлинские и амстердамские, нью-йоркские, вашингтонские и даже один петербургский адреса лиц, фамилии которых написаны по-японски. Он проговорил это с подкупающей искренностью. Он до страсти любил роскошь, нарядную одежду и драгоценные украшения, на нем обыкновенно навешена была целая коллекция цепочек и брелоков.\r\n\r\nОн отыскал Изу и вручил ей документ с просьбой немедленно перевести на французский язык. Наливая вино для Будимирского, она что-то сказала подругам своим, вздохнула и подобрав под голову подушку, легла головой к ногам авантюриста, вытянув одну руку вдоль бедер. Арабески плясали, точно одержимые какой-то пьяной силой, группировались, сплетались и насиловали друг друга в какой-то сладострастной фуге, под аккомпанемент не то хохота и визга, не то цыганской песни и гитары… Осталась навсегда какая-то теплота в их отношениях, какой-то особенный свет, озарявший эти отношения. Смокинг-рум, сэр, смокинг-рум! - объяснял ему китаец назначение этой «курительной» комнаты. Первый раз, сэр, - не больше двух, не больше… Расскажите мне все. Я так страдал во время вашего отсутствия. Только я и без вашего подчеркивания знала, что вас люди занимают только как интересные субъекты, и не рассчитывала на большее! Будимирский поправил галстук, - его душило что-то сладкое, истома охватывала его, в глазах кругом был туман и сквозь него вызыва